#include<iostream>
#include<algorithm> 
#include<string>
#include<cstring>
using namespace std;

class Solution {
public:
// Memory Limit Execed for this testcase
    string shortestPalindrome(string s) {
        string rev = s;
        reverse(begin(rev), end(rev));
        int n = s.length();
        int i;
        for (i = 0; i < n; i++) {
            // because of this substring
            // T.C : (n*n)
            // S.C : (n)
            if (s.substr(0, n - i) == rev.substr(i)) {
                break;
            }
        }
        string suffix = rev.substr(0, i);
        return suffix + s;
    }
};
class Solution2 {
public:
    // T.C : (n^2)
    // S.C : (n)
    string shortestPalindrome(string s) {
        string rev = s;
        reverse(begin(rev), end(rev));
        int n = s.length();
        int i;
        for (i = 0; i < n; i++) {
            if (memcmp(s.c_str(), rev.c_str() + i, s.length() - i) == 0) {
                break;
            }
        }
        string suffix = rev.substr(0, i);
        return suffix + s;
    }
};
int main() {
    Solution s;
    cout << s.shortestPalindrome("abac") << endl;
    Solution2 s2;
    cout << s2.shortestPalindrome("abac") << endl;
    return 0;
}
